import netflixLogo from '../images/netflix_logo.jpg';
import styles from './Navigation.module.css'

function Navigation() {
  return (
    <div className={styles.header}>
      <div>
        <img src={netflixLogo} alt='logo' />
        <span>Home</span>
        <span>Movies</span>
        <span>Series</span>
      </div>
      <div>
        Guests
      </div>
    </div>
  );
};

export default Navigation;
